angular.module('myApp.modifica-recapito', ['ngRoute'])

.config(['$routeProvider', function($routeProvider) {
  $routeProvider.when('/modifica-recapito/:id', {
    templateUrl: 'modifica-recapito/modifica-recapito.html',
    controller: 'modifica-recapitoCtrl'
  });
}])
.controller('modifica-recapitoCtrl', function($scope, $window, $routeParams) {

    $scope.goBack = function() {
      $window.history.back();
    }

  $scope.listaComuniDinamica=listaComuni;
  $scope.listaProvinceDinamica=listaProvince;
  $scope.listaRegioniDinamica=listaRegioni;
  $scope.id = $routeParams.id;
  $scope.elemento=listaRecapiti[$routeParams.id];
  $scope.indirizzo=listaRecapiti[$routeParams.id].indirizzo;
  $scope.cap=listaRecapiti[$routeParams.id].cap;
  $scope.numeroCivico=listaRecapiti[$routeParams.id].numeroCivico;
  $scope.tipologiaDiRecapito=listaRecapiti[$routeParams.id].tipologiaDiRecapito;
  $scope.regione=listaRecapiti[$routeParams.id].regione;
  $scope.provincia=listaRecapiti[$routeParams.id].provincia;
  $scope.comune=listaRecapiti[$routeParams.id].comune;
  $scope.inizioValidita=listaRecapiti[$routeParams.id].inizioValidita;
  $scope.fineValidita=listaRecapiti[$routeParams.id].fineValidita;
  console.log($scope.elemento);
  // recapito = {indirizzo:null,numeroCivico:null,cap:null,regione:null,provincia:null,comune:null,tipologiaDiRecapito:null};
  $scope.modifica = function() {
    if($scope.indirizzo && $scope.numeroCivico && $scope.cap && $scope.regione && $scope.provincia && $scope.comune && $scope.tipologiaDiRecapito && $scope.inizioValidita && $scope.fineValidita){
      var valid = true;
      if(!dateNotInFuture($scope.inizioValidita)){
        valid = false;
        const errorStr = "Inizio validità non può essere nel futuro";
        $("#dateError").css("display", "initial");
        $("#dateError").text(errorStr);
      }
      if(!dateDelay($scope.inizioValidita, $scope.fineValidita)){
        valid = false;
        var errorStr = $("#dateError").text();
        if(errorStr != "") errorStr += "<br>";
        errorStr += "Fine validità deve essere futura a Inizio validità"
        $("#dateError").css("display", "initial");
        $("#dateError").html(errorStr);
      }
      if(valid){
        $("#dateError").css("display", "none");
        $("#dateError").text("");
        const map = {
          indirizzo: $scope.indirizzo,
          numeroCivico: $scope.numeroCivico,
          cap: $scope.cap,
          regione: $scope.regione,
          provincia: $scope.provincia,
          comune: $scope.comune,
          tipologiaDiRecapito: $scope.tipologiaDiRecapito,
          inizioValidita: $scope.inizioValidita,
          fineValidita: $scope.fineValidita
        };
        if($scope.id > -1){
          listaRecapiti.splice($scope.id, 1, map);
          localStorage.setItem("lista",JSON.stringify(listaRecapiti));
          $window.location.href = '#!/recapiti';
        }
        else{
          console.log("ERRORE: INDICE NON VALIDO");
        }
      }
    }
  }

  $scope.validaIndirizzo = {
    regExp: /^[a-zA-Z][a-zA-Z\s]*$/
  };
  $scope.validaCivico = {
    regExp: /^\d+$/
  };
  $scope.validaCap = {
    regExp: /^\d+$/
  };
  $scope.getErrorLabel = function(fieldName, error){
    if(error.required){
      return "Il campo " + fieldName + " è obbligatorio";
    }
    else if(error.pattern){
      if(fieldName == "indirizzo"){
        return "Il campo " + fieldName + " deve contenere solo lettere e spazi";
      }
      else if(fieldName == "civico"){
        return "Il campo " + fieldName + " deve contenere solo numeri positivi";
      }
      else if(fieldName == "cap"){
        return "Il campo " + fieldName + " deve contenere 5 numeri";
      }
      else if(fieldName == "civico"){
        return "Il campo " + fieldName + " può contenere solo numeri";
      }
    }
  };
  $("#inizioValidita").datepicker({
    //showAnim: "slideDown"
  });
  $("#fineValidita").datepicker({
    //showAnim: "slideDown"
  });
});
